/* eslint-disable no-unused-vars */
import React from 'react';
import { Form } from 'antd';
import Input from '../../../components/Input';
import * as S from './style';
import Button from '../../../components/Button';

interface AuthenticatinProps {
    loading: boolean;
    onFinish: (value: any) => void;

}

const Authentication: React.FC<AuthenticatinProps> = ({
  loading, onFinish,
}: AuthenticatinProps) => {


  return (
    <Form
      layout="vertical"
      name="basic"
      initialValues={{ remember: true }}
      onFinish={onFinish}
      data-tst="login-authentication-form"
    >
      <S.WrapperForm>
        <Form.Item
          name="email"
          rules={[
            { required: true, message: 'Por favor, digite um e-mail.' },
          ]}
        >
          <Input
            type="text"
            label="E-mail"
            name="email"
            data-tst="login-email-input"
          />
        </Form.Item>

      </S.WrapperForm>
          <Button
            data-tst="login-authentication-button"
            type="submit"
            width={315}
            height={55}
          >
            CONTINUAR
          </Button>


    </Form>
  );
};
export default Authentication;
